  useEffect(() => {
    Axios({
      url: 'http://localhost:3001/api/session'
    })
      .then(response => {
        setSessions(response.data)
        console.log(response.data);
      })
      .catch(error => {
        console.log(error)
      })
  }, [setSessions])

