  // .then(res => {
  //     const sessions = res.data;
  //     console.log(sessions)
  //   })

  return (
    <div className={Styles.board}>
      {sessions.map(session => (
        <SchedulledSession
          numSession={session.numSession}
          sessionObjective={session.sessionObjective}
          key={session.id}
          id={session.id}
        ></SchedulledSession>
      ))}
    </div>
  )
}

export default SessionsBoard
